import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Navbar } from "react-bootstrap";
import Nav from "react-bootstrap/es/Nav"
import NavItem from "react-bootstrap/es/NavItem"

const style = {
    padding: '10px',
    color: '#050C0E',
    marginTop: '10px',
}

class App extends Component {
    render() {
        return (
            <Navbar inverse collapseOnSelect style={{ padding: '20px'}}>
                <Navbar.Header>
                    <Navbar.Brand>
                        <Link to="/" style={{ color: '#64b7ff'}}>
                            Mcgugin Dining Center Menu
                        </Link>
                    </Navbar.Brand>
                    <Navbar.Toggle />
                </Navbar.Header>
                <Navbar.Collapse>
                  // sth
                </Navbar.Collapse>
            </Navbar>
        );
    }
}

export default App;
